description:
Samantha's husband has taken her to an extravagant bed &amp; breakfast in an effort to rekindle the fading embers of their loveless marriage. Samantha couldn't be less interested, but when she meets another guest who has been roped into a getaway with his significant other, she finds a way to bang and blow some fun into her dull weekend. 


